import Vue from 'vue'
import App from './App.vue'

// 生产环境使用
// import ELEMENT from 'element-ui'
// Vue.use(ELEMENT)

// import './plugins/element.js'

import '../src/assets/css/global.css'
import router from './router'
import store from './store'


Vue.config.productionTip = false

new Vue({
  router,
  store,
  render: h => h(App)
}).$mount('#app')
